import React, { useEffect } from "react";
const list = [];
const Links = (props) => {
  useEffect(() => {
    list.push(props.record);
  });
  console.log(props);
  const toLink = (link) => {
    document.location.href = link;
  };

  return (
    <div
      style={{
        width: 200,
        height: 300,
        position: "absolute",
        backgroundColor: "red",
        right: 0,
        zIndex: 999,
      }}
    >
      {list.map((item, index) => (
        <div onClick={() => toLink(item)}>
          <a>Table {index}</a>
        </div>
      ))}
    </div>
  );
};

export default Links;
